svg.script:
var pauseButton = null; var playButton = null;
function Init(evt){console.log('INIT');SVGDocument=evt.target.ownerDocument;SVGRoot=SVGDocument.documentElement;pauseButton = evt.target.ownerDocument.getElementById('pauseGroup'); playButton = SVGDocument.getElementById('playGroup');Pause()}
function Pause(){console.log('PAUSE');SVGRoot.pauseAnimations();pauseButton.setAttributeNS(null,'display','none');playButton.setAttributeNS(null,'display','inline');};
function Play(){console.log('PLAY');SVGRoot.unpauseAnimations();pauseButton.setAttributeNS(null,'display','inline');playButton.setAttributeNS(null,'display','none');};
